webpackJsonp([0xd8b63dffbd94],{8508:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"The Weekend Is Now",date:"16 Sep 2004",slug:"/2004-09-16-the-weekend-is-now/",tags:"Y2004"},html:'<p>We\'re all three off for a weekend trip to <a href="http://www.bad-wiessee.de/" title="Bad Wiessee am Tegernsee">Tegernsee</a> near Munich, combining Mama\'s business with our pleasure. She has a day-long physical exam, Christopher and I will be checking out the lake and the cable-car lifts.</p>'},next:{fields:{title:"Kerry on Bush",date:"16 Sep 2004",slug:"/2004-09-16-kerry-on-bush/"}},previous:{fields:{title:"Back In Germany",date:"18 Sep 2004",slug:"/2004-09-18-back-in-germany/"}}},{node:{fields:{title:"Kerry on Bush",date:"16 Sep 2004",slug:"/2004-09-16-kerry-on-bush/",tags:"Y2004"},html:'<p><a href="http://www.markarkleiman.com/archives/election_2004_/2004/09/kerry_on_bush.php">Mark A. R. Kleiman: Kerry on Bush</a> "George Bush is proud of the fact that not even failure can cause him to change his mind."</p>'},next:{fields:{title:"Cost of Life",date:"16 Sep 2004",slug:"/2004-09-16-cost-of-life/"}},previous:{fields:{title:"The Weekend Is Now",date:"16 Sep 2004",slug:"/2004-09-16-the-weekend-is-now/"}}},{node:{fields:{title:"Cost of Life",date:"16 Sep 2004",slug:"/2004-09-16-cost-of-life/",tags:"Y2004"},html:'<p>Just to put the current German debates on health care and education in perspective, Seth reports how <a href="http://www.sethb.com/weblog/archive/2004/09/iowa_college_pr.html" title="Seth-Tech: Iowa college prices draw F rating">tuition at public colleges in Iowa is up 71%</a> in five years. He also points to Tom and Dori, who <a href="http://www.backupbrain.com/2004_09_12_archive.html#a004155">needed  individual health insurance</a> after having lost their coverage. They found a Health Savings Account plan, a creation of the Bush Administration, which is more expensive, gives worse coverage, and if widely adopted would erode the entire American health insurance system.</p>\n<p>Have a nice day.</p>'},next:{fields:{title:"Offering Degrees in New German?",date:"15 Sep 2004",slug:"/2004-09-15-offering-degrees-in-new-german/"}},previous:{fields:{title:"Kerry on Bush",date:"16 Sep 2004",slug:"/2004-09-16-kerry-on-bush/"}}}],pathPrefix:"",first:!1,last:!1,index:420,pageCount:1101}}}});
